import React from 'react';
import ReactDOM from 'react-dom';
// import './index.css';
import App from './App';
import Card from './Netflix_App/Card';
import Sdata from './Netflix_App/Sdata'

function ncard(val){
  return(
    <Card 
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link}
    />
  );
}

ReactDOM.render( <>

  <h1> My Favourite OTT Series... </h1>
  Sdata.map(ncard);
  </>,
  document.getElementById("root"));
